import React from 'react'

export default function BoardFlyts(props) {



  return (
    <div>
        <table className='table'>
            {props.flyts.map((fly) => {
                return (
                    <tr className='tr' > 
                        <td>{fly.flytN}</td>
                        <td>{fly.company}</td>
                        <td>{fly.passengerN}</td>
                    </tr>
                )
            })}
        </table>
    </div>
  )
}
